import QuoteList from "../components/quotes/QuoteList";
const DUMMY_QUOTES = [
  {
    id: "q1",
    author: "Sonali",
    text: "Hello! Welcome to the world",
  },
  {
    id: "q2",
    author: "John",
    text: "Happy Earth Day",
  },
  {
    id: "q3",
    author: "Sachin",
    text: "Enjoy the Match",
  },
];
const AllQuotes = () => {
  return <QuoteList quotes={DUMMY_QUOTES} />;
};

export default AllQuotes;
